import React from "react";
import { Route, BrowserRouter as Router, Switch } from "react-router-dom";
import Navbar from "./Comp/Navbar";
import "./App.css"
import Home from "./Comp/Pages/Home.js";

function App () {
  return (
      <>
        <Router>
          <Navbar />
            <Switch>
              <Route path='/' exact component={Home}/>
              <Home/>
            </Switch>
        </Router>

      </>
  );
}

export default App;
